  selector: 'mx-button-list',
  templateUrl: './button-list.component.html',
  styleUrls: ['./button-list.component.scss'],
})
export class ButtonListComponent implements OnInit, OnChanges {

  @Input() title: string;
  @Input() buttons: string[];
  @Input() values: string[];
  @Input() preview = true;
  @Output() onClick: EventEmitter<any> = new EventEmitter<any>();

  previewButtons: string[];

  constructor() {
  }


  ngOnInit() {
  }

  ngOnChanges(changes: SimpleChanges) {
    if (changes.buttons) {
      this.previewButtons = this.buttons.length > 3 ? this.buttons.slice(0, 3) : this.buttons;
    }
  }

  public onClickEvent($event) {
    this.values = Utils.addRemoveListItem(this.values, $event);
    this.onClick.emit(this.values);
  }

  onOtherClick($event) {
    this.previewButtons = this.buttons;
  }

  public isSelected($event): boolean {
    return this.values.includes($event);
  }

}

